import React from "react";
import {
  View,
  Text,
  Image,
  TouchableOpacity,
  ScrollView,
  StyleSheet,
  SafeAreaView,
} from "react-native";
import { Ionicons } from "@expo/vector-icons";
import { useNavigation } from "@react-navigation/native";
import { StackNavigationProp } from "@react-navigation/stack";
import { RootStackParamList } from "../types/navigation";

// 실제 이미지 파일이 추가되면 주석을 해제하세요
// const productImage = require("../../assets/images/ptoduct-image.png");
// const wifiIcon = require("../../assets/images/wifi.png");
// const foodIcon = require("../../assets/images/food.png");
// const bathTubIcon = require("../../assets/images/bath-tub.png");
// const frameIcon = require("../../assets/images/frame.png");

// 네비게이션 타입 수정
type AspenHomeScreenNavigationProp = StackNavigationProp<
  RootStackParamList,
  "AspenHome"
>;

// 컴포넌트 이름 수정
const AspenHomeScreen = () => {
  const navigation = useNavigation<AspenHomeScreenNavigationProp>();

  // AspenDetail 화면으로 이동하는 함수 추가
  const goToDetail = () => {
    navigation.navigate("AspenDetail");
  };

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.scrollView}>
        {/* 상품 이미지 */}
        {/* 실제 이미지가 추가되면 주석을 해제하세요 */}
        {/* <Image
          source={productImage}
          style={styles.productImage}
          resizeMode="cover"
        /> */}
        <View
          style={[
            styles.productImage,
            {
              backgroundColor: "#f0f0f0",
              justifyContent: "center",
              alignItems: "center",
            },
          ]}
        >
          <Text style={{ fontFamily: "CircularXX-Medium" }}>
            이미지가 추가되면 표시됩니다
          </Text>
        </View>

        {/* 콘텐츠 섹션 */}
        <View style={styles.contentContainer}>
          {/* 제목 및 평점 */}
          <View style={styles.titleContainer}>
            <Text style={styles.title}>Coeurdes Alpes</Text>

            <View style={styles.ratingRow}>
              <View style={styles.ratingContainer}>
                <Ionicons name="star" size={16} color="#FFD700" />
                <Text style={styles.ratingText}>4.5 (355 Reviews)</Text>
              </View>
              <TouchableOpacity>
                <Text style={styles.showMapText}>Show map</Text>
              </TouchableOpacity>
            </View>
          </View>

          {/* 설명 */}
          <Text style={styles.description}>
            Aspen is as close as one can get to a storybook alpine town in
            America. The choose-your-own-adventure possibilities—skiing, hiking,
            dining shopping and ....
          </Text>

          {/* 더 읽기 버튼 */}
          <TouchableOpacity style={styles.readMoreContainer}>
            <Text style={styles.readMoreText}>Read more</Text>
            <Ionicons name="chevron-down" size={18} color="#176FF2" />
          </TouchableOpacity>

          {/* 시설 섹션 */}
          <View style={styles.facilitiesSection}>
            <Text style={styles.sectionTitle}>Facilities</Text>

            <ScrollView
              horizontal
              showsHorizontalScrollIndicator={false}
              style={styles.facilitiesContainer}
            >
              <View style={styles.facilityItem}>
                <View
                  style={{
                    width: 32,
                    height: 32,
                    backgroundColor: "#f0f0f0",
                    borderRadius: 16,
                    marginBottom: 6,
                  }}
                />
                <Text style={styles.facilityText}>1 Heater</Text>
              </View>

              <View style={styles.facilityItem}>
                <View
                  style={{
                    width: 32,
                    height: 32,
                    backgroundColor: "#f0f0f0",
                    borderRadius: 16,
                    marginBottom: 6,
                  }}
                />
                <Text style={styles.facilityTextGray}>Dinner</Text>
              </View>

              <View style={styles.facilityItem}>
                <View
                  style={{
                    width: 32,
                    height: 32,
                    backgroundColor: "#f0f0f0",
                    borderRadius: 16,
                    marginBottom: 6,
                  }}
                />
                <Text style={styles.facilityTextGray}>1 Tub</Text>
              </View>

              <View style={styles.facilityItem}>
                <View
                  style={{
                    width: 32,
                    height: 32,
                    backgroundColor: "#f0f0f0",
                    borderRadius: 16,
                    marginBottom: 6,
                  }}
                />
                <Text style={styles.facilityTextGray}>Pool</Text>
              </View>
            </ScrollView>
          </View>
        </View>
      </ScrollView>

      {/* 하단 예약 섹션 */}
      <View style={styles.bookingSection}>
        <View style={styles.priceContainer}>
          <Text style={styles.priceLabel}>Price</Text>
          <Text style={styles.price}>$199</Text>
        </View>

        <TouchableOpacity style={styles.bookButton} onPress={goToDetail}>
          <Text style={styles.bookButtonText}>Book Now</Text>
          <Ionicons name="arrow-forward" size={20} color="white" />
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  );
};

// 나머지 코드는 그대로 유지
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor:
      "linear-gradient(161deg, rgba(231,233,243,1) 0%, rgba(255,255,255,1) 100%)",
  },
  scrollView: {
    flex: 1,
  },
  productImage: {
    width: "100%",
    height: 386,
  },
  contentContainer: {
    paddingHorizontal: 20,
    paddingTop: 20,
  },
  titleContainer: {
    marginBottom: 16,
  },
  title: {
    fontFamily: "Montserrat-SemiBold",
    fontSize: 24,
    color: "#232323",
    marginBottom: 10,
  },
  ratingRow: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  ratingContainer: {
    flexDirection: "row",
    alignItems: "center",
  },
  ratingText: {
    fontFamily: "CircularXX-Regular",
    fontSize: 12,
    color: "#5F5F5F",
    marginLeft: 8,
  },
  showMapText: {
    fontFamily: "CircularXX-Bold",
    fontSize: 14,
    color: "#176FF2",
  },
  description: {
    fontFamily: "CircularXX-Book",
    fontSize: 14,
    color: "#3A544F",
    lineHeight: 20,
    marginBottom: 16,
  },
  readMoreContainer: {
    flexDirection: "row",
    alignItems: "center",
    marginBottom: 24,
  },
  readMoreText: {
    fontFamily: "CircularXX-Bold",
    fontSize: 14,
    color: "#176FF2",
    marginRight: 4,
  },
  facilitiesSection: {
    marginBottom: 24,
  },
  sectionTitle: {
    fontFamily: "Montserrat-SemiBold",
    fontSize: 18,
    color: "#232323",
    marginBottom: 16,
  },
  facilitiesContainer: {
    flexDirection: "row",
  },
  facilityItem: {
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "rgba(23,111,242,0.05)",
    borderRadius: 16,
    paddingHorizontal: 20,
    paddingVertical: 12,
    marginRight: 14,
  },
  facilityIcon: {
    width: 32,
    height: 32,
    marginBottom: 6,
  },
  facilityText: {
    fontFamily: "CircularXX-Book",
    fontSize: 10,
    color: "#B8B8B8",
  },
  facilityTextGray: {
    fontFamily: "CircularXX-Book",
    fontSize: 10,
    color: "#C8C8C8",
  },
  bookingSection: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    paddingHorizontal: 20,
    paddingVertical: 16,
    backgroundColor: "white",
    borderTopWidth: 1,
    borderTopColor: "#F5F5F5",
  },
  priceContainer: {
    flexDirection: "column",
  },
  priceLabel: {
    fontFamily: "CircularXX-Medium",
    fontSize: 12,
    color: "#232323",
  },
  price: {
    fontFamily: "Montserrat-Bold",
    fontSize: 24,
    color: "#2CD6A3",
  },
  bookButton: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#176FF2",
    paddingHorizontal: 32,
    paddingVertical: 16,
    borderRadius: 16,
    shadowColor: "#0038FF",
    shadowOffset: { width: 0, height: 6 },
    shadowOpacity: 0.24,
    shadowRadius: 19,
    elevation: 5,
  },
  bookButtonText: {
    fontFamily: "CircularXX-Bold",
    fontSize: 16,
    color: "white",
    marginRight: 8,
  },
});

// 컴포넌트 이름 수정
export default AspenHomeScreen;
